import { createAsyncThunk } from '@reduxjs/toolkit';
import axios from 'axios'


const listUsers = createAsyncThunk('users', async () => {

    const { data } = await axios.get('https://jsonplaceholder.typicode.com/users');
    return data;
})

export { listUsers }
